import React from "react";
import "../assets/scss/_skyz-demo.scss";
import Kanban from "./Kanban";

const Demo = () => {
  const kanbanData1 = {
    columns: {
      columnId: {
        title: "פתוח",
        subtitle: "פוטנציאלי",
        taskIds: ["task1", "task2", "task3"],
      },
      columnId2: {
        title: "ביצוע",
        subtitle: "הצעה",
        taskIds: ["task4", "task5", "task6"],
      },
      columnId3: {
        title: "סגור",
        subtitle: "הזמנה",
        taskIds: ["task7", "task8", "task9"],
      },
    },
    tasks: {
      task1: { title: "פוטנציאלי", description: "הזדמנות" },
      task2: { title: "Task 2", description: "Description 2" },
      task3: { title: "Task 3", description: "Description 3" },
      task4: { title: "Task 4", description: "Description 4" },
      task5: { title: "Task 5", description: "Description 5" },
      task6: { title: "Task 6", description: "Description 6" },
      task7: { title: "Task 7", description: "Description 7" },
      task8: { title: "Task 8", description: "Description 8" },
      task9: { title: "Task 9", description: "Description 9" },
    },
  };

  const kanbanData2 = {
    columns: {
      columnId: {
        title: "בתהליך",
        subtitle: "פוטנציאלי",
        taskIds: ["task1", "task2", "task3"],
      },
      columnId2: {
        title: "ביצוע",
        subtitle: "הצעה",
        taskIds: ["task4", "task5", "task6"],
      },
      columnId3: {
        title: "סגור",
        subtitle: "הזמנה",
        taskIds: ["task7", "task8", "task9"],
      },
    },
    tasks: {
      task1: { title: "פוטנציאלי", description: "הזדמנות" },
      task2: { title: "Task 2", description: "Description 2" },
      task3: { title: "Task 3", description: "Description 3" },
      task4: { title: "Task 4", description: "Description 4" },
      task5: { title: "Task 5", description: "Description 5" },
      task6: { title: "Task 6", description: "Description 6" },
      task7: { title: "Task 7", description: "Description 7" },
      task8: { title: "Task 8", description: "Description 8" },
      task9: { title: "Task 9", description: "Description 9" },
    },
  };

  const kanbanData3 = {
    columns: {
      // ... your data for Kanban 3
    },
    tasks: {
      // ... your data for Kanban 3
    },
  };

  return (
    <div className="skyz-demo">
      <div className="demo-container">
        <div className="skyz-demo__main">
          <div className="card-container">
            <div className="card">
              <div className="kanban-container">
                <Kanban initialData={kanbanData1} />
                <Kanban initialData={kanbanData2} />
                <Kanban initialData={kanbanData3} />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Demo;
